import React from "react";
import ReactDOM from "react-dom";
import GifPicker from "./GifPicker";

const App: React.FC = () => {
  return (
    <div>
      <h1>GIF Picker</h1>
      <GifPicker />
    </div>
  );
};

ReactDOM.render(<App />, document.getElementById("root"));
